import React , {useState} from 'react';
import "./App.css";

const App = ()=>{
  const [todos, setTodos] = useState([]);

  return (
    <div className='App'>
      <h1> TODO LIST</h1>
      <form>
        <input type='text' id='todos'/><br/>
        <button type='submit'>Add ToDo</button>
      </form>
    </div>
  )
};

export default App;
